import XCTest

final class SlidingWindowTests: XCTestCase {
    
    typealias Solution = SlidingWindow.Solution
    let solution = Solution()

    override func setUpWithError() throws {
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }

    override func tearDownWithError() throws {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
    }

    func testExample() throws {
        // This is an example of a functional test case.
        // Use XCTAssert and related functions to verify your tests produce the correct results.
        // Any test you write for XCTest can be annotated as throws and async.
        // Mark your test throws to produce an unexpected failure when your test encounters an uncaught error.
        // Mark your test async to allow awaiting for asynchronous code to complete. Check the results with assertions afterwards.
        let s1 = "EBBANCF"
        let t1 = "ABC"
        let r1 = solution.minWindow(s1, t1)
        
        let s2 = "ADOBECODEBANC"
        let t2 = "ABC"
        let r2 = solution.minWindow(s2, t2)
        
        let s3 = "a"
        let t3 = "aa"
        let r3 = solution.minWindow(s3, t3)
        
        XCTAssertEqual(r1, "BANC")
        XCTAssertEqual(r2, "BANC")
        XCTAssertEqual(r3, "")
    }
    
    func testV2() {
        let s1 = "EBBANCF"
        let t1 = "ABC"
        let r1 = solution.minWindowV2(s1, t1)
        
        let s2 = "ADOBECODEBANC"
        let t2 = "ABC"
        let r2 = solution.minWindowV2(s2, t2)
        
        let s3 = "a"
        let t3 = "aa"
        let r3 = solution.minWindowV2(s3, t3)
        
        XCTAssertEqual(r1, "BANC")
        XCTAssertEqual(r2, "BANC")
        XCTAssertEqual(r3, "")
    }
    
    func testLongTime() {
        let s3 = ""
        let t3 = ""
        let r3 = solution.minWindowV2(s3, t3)
        XCTAssertEqual(r3, "")
    }
    
    func testCheckInclusion() {
        let r1 = solution.checkInclusion("ab", "eidbaooo")
        let r2 = solution.checkInclusion("ab", "eidboaoo")
        
        XCTAssertTrue(r1)
        XCTAssertFalse(r2)
    }
    
    func testFindAnagrams() {
        let r1 = solution.findAnagrams("cbaebabacd", "abc")
        let r2 = solution.findAnagrams("abab", "ab")
        
        XCTAssertEqual(r1, [0,6])
        XCTAssertEqual(r2, [0, 1, 2])
    }
    
    func testLengthOfLongestSubstring() {
        let r1 = solution.lengthOfLongestSubstring("abcabcbb")
        let r2 = solution.lengthOfLongestSubstring("bbbbb")
        let r3 = solution.lengthOfLongestSubstring("pwwkew")
        
        XCTAssertEqual(r1, 3)
        XCTAssertEqual(r2, 1)
        XCTAssertEqual(r3, 3)
        
    }
    
    func testFindRepeatedDnsSequences() {
        let s = SlidingWindowAdditions()
        let r = s.findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT")
        XCTAssertTrue(r.contains("AAAAACCCCC"))
        XCTAssertTrue(r.contains("CCCCCAAAAA"))
        
        let r2 = s.findRepeatedDnaSequencesV2("AAAAAAAAAAAAA")
        XCTAssertTrue(r2.contains("AAAAAAAAAA"))
    }

    func testPerformanceExample() throws {
        // This is an example of a performance test case.
        self.measure {
            // Put the code you want to measure the time of here.
        }
    }

}
